import axios from "axios";

export async function getGeoLocationAPI() {
    // 현재 위치 정보 - 좌표
    const geoLocation = navigator.geolocation.getCurrentPosition((position) => {
        return [position.coords.latitude, position.coords.longitude]
      })

      return geoLocation;
}
